// CRITICAL: For TYPO3 deployment, change this back to your TYPO3 embed ID

// const root = ReactDOM.createRoot(document.getElementById('react-kanban-board-container'));
// root.render(
//   <React.StrictMode>
//     <App />
//   </React.StrictMode>
// );


const container = document.getElementById('kanban-root') || document.getElementById('root');

if (container) {
  const root = ReactDOM.createRoot(container);
  root.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );
} else {
  console.error("Konnte kein Element mit ID 'kanban-root' oder 'root' finden!");
}




// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
